#!/usr/bin/env python3

"""
** BiReUS demo-repo generator
This script generates you an example-server repository with 2 versions.
"""

from pathlib import Path
import shutil
import json

from shared import remove_folder


def create_test_server_data(path: Path):
    repo_path = path.joinpath("repo_demo")

    def create_simplefile(path: Path, name: str, content: str) -> str:
        abs_path = str(path.joinpath(name))
        with open(abs_path, 'w+') as file:
            file.write(content)
            return abs_path

    if repo_path.exists():
        shutil.rmtree(str(repo_path))

    repo_path.mkdir(parents=True)
    repo_path.joinpath("v1").mkdir()
    repo_path.joinpath("v2").mkdir()
    repo_path.joinpath("temp1").mkdir()
    repo_path.joinpath("temp2").mkdir()

    # example-server of unchanged-action
    create_simplefile(repo_path.joinpath("v1"), "unchanged.txt", "This file will be unchanged.")
    create_simplefile(repo_path.joinpath("v2"), "unchanged.txt", "This file will be unchanged.")

    # example-server of remove-actions
    create_simplefile(repo_path.joinpath("v1"), "removed.txt", "This file will be removed in v2.")
    repo_path.joinpath("v1", "removed_folder").mkdir()
    create_simplefile(repo_path.joinpath("v1", "removed_folder"), "obsolete.txt",
                      "This file is obselete, because the folder will be removed in v2.")

    # example-server of add-actions
    repo_path.joinpath("v2", "new_folder").mkdir()
    create_simplefile(repo_path.joinpath("v2", "new_folder"), "new_file.txt", "This file will be new in v2.")

